import React from "react";

const Photo = () => {
  const images = [
    "/images/gallery1.JPG",
    "/images/gallery2.jpg",
    "/images/gallery3.jpg",
  ];

  return (
    <div className="grid md:grid-cols-3 gap-4 p-16">
      {images.map((img, index) => (
        <img
          key={index}
          src={img}
          alt={`gallery-${index}`}
          className="w-full h-64 object-cover rounded-lg"
        />
      ))}
    </div>
  );
};

export default Photo;
